import React from "react";
import { Component } from "react";

class DisplayProductOverview extends Component {

    render(){

        return(

            <div >

              { this.props.products.map((product, key) => {
                return(
                  <div className="product" key={key} >
                   <div className="product_organic"> allah</div>
                    <ul id="postList" className="list-group list-group-flush">
                      <li className="list-group-item">
                      <p> <span>  NAME: <input value={product.productname} /> </span>
                      <span>UPC:     {product.upc.toNumber()}</span>
                      <span>Price:  {product.price.toNumber()}</span> </p>
                        {/* <p>ABOUT:   {product.productdescription}</p> */}

                      </li>
                    </ul>
                    </div>

                )
              }
              )
            }


            </div>


        )
    }
}

export default DisplayProductOverview;
